import React from 'react';
import './Header.css';

const MenuItem = ({active, children, to}) => (
    <div className="menu-item">
            {children}
    </div>
)

const Header = () => {
    return (    
        <div>
            <div className="logo">
                <a href = "https://naver.com"> Value +</a>
            </div>
        </div>
    );
};

export default Header;

